import './App.css';
import Navbar from './components/navbar';
import Header from './components/header';
import React from 'react'
import Numbers from './components/numbers';

export class App extends React.Component {

  render() {
    return (
      <div>
        <Navbar /> 
        <Header />
        <Numbers />
      </div>
    )
  }
}

export default App;
